import re


def replace_dynamic(log):
    # 获取动态变量
    dynamic = []
    for i in range(len(log)):
        if log[i] == "{":
            dynamic.append(i)
    # 替换为占位符
    for i in range(len(dynamic)):
        log = log[:dynamic[i]] + "{" + str(i+1) + "}" + log[dynamic[i]+1:]
    return log, dynamic


def find_all_dynamic(logs):
    dynamic = {}
    for log in logs:
        log, dyn = replace_dynamic(log)
        for i in dyn:
            if i not in dynamic:
                dynamic[i] = [log]
            else:
                dynamic[i].append(log)
    return dynamic


